import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';


function App() {
    return ( < MDBCard >
        <
        MDBCardBody >
        <
        MDBCardTitle > Card title < /MDBCardTitle> <MDBCardText>
        Some quick example text to build on the card title and make up the bulk of the card 's content. </MDBCardText > <
        MDBBtn > Button < /MDBBtn>  </MDBCardBody > < /MDBCard>

    );
}

export default App;
